class App extends Component{
  render() {
    return (
      <div>
        <nav className="navbar navbar-inverse">
        <a className="navbar-brand" href="#">Title</a>
        <ul className="nav navbar-nav">
          <li className="active">
            <a >Home</a>
          </li>
          <li>
            <a >Link</a>
          </li>
        </ul>
      </nav>
      </div>



    );
  };
};

export default App;
